In #5049 ,The problem that the proposed custom op supports dynamic input seems to be solved.

But  in my case, I need to implement a two-input op, but the types of the two inputs are not fixed, there will be problems when using custom_library, it is not possible to set both inputs to Undefined, only when these two are of the same type are supported.
And the output of my custom op is fixed. 

The example is shown below.
![custom](https://user-images.githubusercontent.com/33832771/105934396-0c6b2080-608b-11eb-82b4-7f355941f2cc.jpg)


``` c++
 size_t GetInputTypeCount() const { return 2; };
  ONNXTensorElementDataType GetInputType(size_t /*index*/) const { return ONNX_TENSOR_ELEMENT_DATA_TYPE_UNDEFINED; };

  size_t GetOutputTypeCount() const { return 1; };
  ONNXTensorElementDataType GetOutputType(size_t /*index*/) const { return ONNX_TENSOR_ELEMENT_DATA_TYPE_INT8; };
```

HOW can I support this kind of  CustomOp by custom_op_library?

**Is your feature request related to a problem? Please describe.**
The DNNL, TensorRT and OpenVINO providers are now created as shared libraries loaded by ONNX Runtime using the system library loader from a hardcoded path relative to the runtime's path. This conflicts with how Java wants to load the libraries, as they are all bundled into the jar file, extracted at runtime and loaded via the Java `System.loadLibrary` call. As a result these shared providers are currently broken in the Java API and cannot be used. 

**Describe the solution you'd like**
A way to access the provider registration through the C API, and to disable library unloading as the OS will do that for us when the JVM shuts down.

**Describe alternatives you've considered**
We could extract the providers from the jar file when the C API is initialised and write to the current runtime directory so they get picked up by the loader in the C++ code. This will leave files lying around in unexpected directories and they may not get cleaned up properly due to an issue with how `File.deleteOnExit()` works on Windows for dlls.

Alternatively we could add documentation on how to compile the shared library providers and ask users to put them in the right folder before running ORT, which is very unfriendly to the users.

**Additional context**
I think the providers are loaded in this block:

```C++
  Provider* Get() {
    if (provider_)
      return provider_;

    if (!s_library_shared.Ensure())
      return nullptr;

    std::string full_path = Env::Default().GetRuntimePath() + std::string(filename_);
    auto error = Env::Default().LoadDynamicLibrary(full_path, &handle_);
    if (!error.IsOK()) {
      LOGS_DEFAULT(ERROR) << error.ErrorMessage();
      return nullptr;
    }

    Provider* (*PGetProvider)();
    Env::Default().GetSymbolFromLibrary(handle_, "GetProvider", (void**)&PGetProvider);

    provider_ = PGetProvider();
    return provider_;
  }
```
so I think I'd need a method that lets me write the `GetProvider` pointer into the struct, and then add a hook to ignore the unload.

The unload might actually work anyway as it's been loaded by the same process, but until I can get control of the library loading its difficult to test.
